### 2.1. Cooling radiation from the shock breakout of an RSG envelope

A shock breakout emerges when the shock reaches the edge of the star, in which the optical depth is approximate $c / V_{\text {sh }}$, where $V_{\text {sh }}$ is the shock velocity, and $c$ is the light speed. Meanwhile, the subsequent expanding cooling envelope can contribute to the early-time emission on a timescale of about a few days. In the case of the shock breakout of an RSG, the corresponding emission is in thermal equilibrium. The luminosity $(L)$ and temperature $(T)$ evolve as below (Nakar \& Sari 2010),

$$
\begin{aligned}
L & =10^{44} \mathrm{erg} \mathrm{~s}^{-1} M_{15}^{-0.37} R_{500}^{2.46} E_{51}^{0.3} t_{\mathrm{hr}}^{-4 / 3} \\
T & =10 \mathrm{eV} M_{15}^{-0.22} R_{500}^{0.12} E_{51}^{0.23} t_{\mathrm{hr}}^{-0.36}
\end{aligned}
$$

where $M_{15}, R_{500}$, and $E_{51}$ are the progenitor mass ( $M_{\text {star }}$ ), progenitor radius ( $R_{\text {star }}$ ), and the explosion energy ( $E_{\mathrm{ej}}$ ) in units of $15 \mathrm{M}_{\odot}, 500 \mathrm{R}_{\odot}$, and $10^{51} \mathrm{erg}$, respectively. $t_{\mathrm{hr}}$ is the time since the explosion with the hour unit. The above equation is applicable to $t<t_{\mathrm{tr}}$, where $t_{\mathrm{tr}}$ is a transition time from the planar phase to spherical phase expressed as $t_{\mathrm{tr}}=$ $14 \mathrm{hr} M_{15}^{0.43} R_{500}^{1.26} E_{51}^{-0.56}$ (Nakar \& Sari 2010). For $t>t_{\mathrm{s}}$, the corresponding luminosity and temperature are expressed as (Nakar \& Sari 2010),

$$
\begin{aligned}
L & =3 \times 10^{42} \mathrm{erg} \mathrm{~s}^{-1} M_{15}^{-0.87} R_{500}^{1.0} E_{51}^{0.96} t_{\mathrm{d}}^{-0.17} \\
T & =3 \mathrm{eV} M_{15}^{-0.13} R_{500}^{0.38} E_{51}^{0.11} t_{\mathrm{d}}^{-0.56}
\end{aligned}
$$

where $t_{\mathrm{d}}$ is the time with the unit of day. The shock cooling emission occurs below the unshocked CSM, and the simplification of ignoring the diffusion effect within the unshocked CSM may introduce some bias. In this paper, the photons calculated from Equation 1 and Equation 2 are injected into the unshocked CSM to generate the final light curve of the shock cooling component through our Monte Carlo procedure.
